$(document).ready(function(){var o=$(".js-overlay");$(".js-close-popup").click(function(){$(this).parents(".js-popup").show(),o.show()}),o.click(function(){$(this).hide(),$(".js-popup").hide()}),$(".js-question").click(function(){return $(".js-popup-question").show(),o.show(),!1}),$(".js-return-link").click(function(){return $(".js-popup-return").show(),o.show(),!1})});